import { Cabeza } from './componente/Cabeza';
import Banner from './componente/Banner';
import CategoriesOfTheMonth from './componente/CategoriesOfTheMonth';
import Menu from './componente/Menu';
import Footer from './componente/Footer';


function App() {
  return (
    <div>
    <Cabeza></Cabeza>
    <Menu></Menu>
    <Banner></Banner>
    <CategoriesOfTheMonth></CategoriesOfTheMonth>
    <Footer></Footer>
      </div>
    );
    
}



export default App;
